PROBLEM: 'A triangle with vertices '$(6, 5)$', '$(8, -3)$', and '$(9, 1)$' is reflected about the line '$x=8$' to create a second triangle.  What is the area of the union of the two triangles?\n'
=======
CHOICES:
[A]: 9
[B]: \frac{28}{3}
[C]: 10
[D]: \frac{31}{3}
[E]: \frac{32}{3}

PROBLEM: 'A unit square is rotated '$45^\circ$' about its center.  What is the area of the region swept out by the interior of the square?  \n'
=======
CHOICES:
[A]: 1 - \frac{\sqrt2}{2} + \frac{\pi}{4}
[B]: \frac{1}{2} + \frac{\pi}{4}
[C]: 2 - \sqrt2 + \frac{\pi}{4}
[D]: \frac{\sqrt2}{2} + \frac{\pi}{4}
[E]: 1 + \frac{\sqrt2}{4} + \frac{\pi}{8}
